script: |
  super -f text -I q6455.spq | sort > q6455.out

inputs:
  - name: q6455.spq
    data: |
      SELECT ALL - col0 / + ( col2 ) + - cor0.col2 - ( + 65 + col1 ) * - 20 AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q6455.out
    data: |
      1442
      1464
      1766
